import React, { Component } from 'react'
import { Button } from 'reactstrap'

export default function NewBSBtnFunc() {

    let btnArray = ["Red", "Blue", "Yellow"]

    btnArray.forEach()

    let newBtn = React.createElement(
      Button,
      {variant: 'primary'},
      'New Button',
    )

    btnArray.forEach(newBtn)
    return    
}
